import React from "react";

const Card = (props) => {
  const apiLink = "https://robohash.org/";

  //   props = {id, name, username, email}

  return (
    <div className=" tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5">
      <img src={`${apiLink}${props.id}?200x200`} alt="roboFoto" />
      <div>
        <h2>{props.name}</h2>
        <p>{props.email}</p>
      </div>
    </div>
  );
};

export default Card;
